import React from 'react';
import { Link } from 'react-router-dom';
import './LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-container">
      <div className="landing-content">
        <h1 className="landing-title">Finansal Analiz Uygulaması</h1>
        <p className="landing-subtitle">Finansal hayatınızı yönetmek için hemen giriş yapın veya kaydolun.</p>
        <div className="landing-buttons">
          <Link to="/login" className="landing-button">Giriş Yap</Link>
          <Link to="/register" className="landing-button landing-button--secondary">Kayıt Ol</Link>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
